Z=L+"#ifndef WEBGL2\n#extension GL_OES_standard_derivatives : enable\n#endif\n\n#if 0\n  // simulate integer math using floats\n\t#define int float\n\t#define ivec2 vec2\n\t#define INT(x) float(x)\n\n\tint ifloor(float v) { return floor(v); }\n\tivec2 ifloor(vec2 v) { return floor(v); }\n\n#else\n  // use native integer math\n\tprecision highp int;\n\t#define INT(x) x\n\n\tint ifloor(float v) { return int(v); }\n\tint ifloor(int v) { return v; }\n\tivec2 ifloor(vec2 v) { return ivec2(v); }\n\n#endif\n\nuniform sampler2D uSamplerStrokes;\nuniform sampler2D uSamplerRowStrokes;\nuniform sampler2D uSamplerRows;\nuniform sampler2D uSamplerColStrokes;\nuniform sampler2D uSamplerCols;\n\nuniform ivec2 uStrokeImageSize;\nuniform ivec2 uCellsImageSize;\nuniform ivec2 uGridImageSize;\n\nuniform ivec2 uGridOffset;\nuniform ivec2 uGridSize;\nuniform vec4 uMaterialColor;\n\nIN vec2 vTexCoord;\n\n// some helper functions\nint ROUND(float v) { return ifloor(v + 0.5); }\nivec2 ROUND(vec2 v) { return ifloor(v + 0.5); }\nfloat saturate(float v) { return clamp(v, 0.0, 1.0); }\nvec2 saturate(vec2 v) { return clamp(v, 0.0, 1.0); }\n\nint mul(float v1, int v2) {\n  return ifloor(v1 * float(v2));\n}\n\nivec2 mul(vec2 v1, ivec2 v2) {\n  return ifloor(v1 * vec2(v2) + 0.5);\n}\n\n// unpack a 16-bit integer from a float vec2\nint getInt16(vec2 v) {\n  ivec2 iv \x3d ROUND(v * 255.0);\n  return iv.x * INT(128) + iv.y;\n}\n\nvec2 pixelScale;\nvec2 coverage \x3d vec2(0.0);\nvec2 weight \x3d vec2(0.5);\nconst float minDistance \x3d 1.0/8192.0;\nconst float hardness \x3d 1.05; // amount of antialias\n\n// the maximum number of curves in a glyph\nconst int N \x3d INT(250);\n\n// retrieves an indexed pixel from a sampler\nvec4 getTexel(sampler2D sampler, int pos, ivec2 size) {\n  int width \x3d size.x;\n  int y \x3d ifloor(pos / width);\n  int x \x3d pos - y * width;  // pos % width\n\n  return TEXTURE(sampler, (vec2(x, y) + 0.5) / vec2(size));\n}\n\nvoid calulateCrossings(vec2 p0, vec2 p1, vec2 p2, out vec2 C1, out vec2 C2) {\n\n  // get the coefficients of the quadratic in t\n  vec2 a \x3d p0 - p1 * 2.0 + p2;\n  vec2 b \x3d p0 - p1;\n  vec2 c \x3d p0 - vTexCoord;\n\n  // found out which values of 't' it crosses the axes\n  vec2 surd \x3d sqrt(max(vec2(0.0), b * b - a * c));\n  vec2 t1 \x3d ((b - surd) / a).yx;\n  vec2 t2 \x3d ((b + surd) / a).yx;\n\n  // approximate straight lines to avoid rounding errors\n  if (abs(a.y) \x3c 0.001)\n    t1.x \x3d t2.x \x3d c.y / (2.0 * b.y);\n\n  if (abs(a.x) \x3c 0.001)\n    t1.y \x3d t2.y \x3d c.x / (2.0 * b.x);\n\n  // plug into quadratic formula to find the corrdinates of the crossings\n  C1 \x3d ((a * t1 - b * 2.0) * t1 + c) * pixelScale;\n  C2 \x3d ((a * t2 - b * 2.0) * t2 + c) * pixelScale;\n}\n\nvoid coverageX(vec2 p0, vec2 p1, vec2 p2) {\n\n  vec2 C1, C2;\n  calulateCrossings(p0, p1, p2, C1, C2);\n\n  // determine on which side of the x-axis the points lie\n  bool y0 \x3d p0.y \x3e vTexCoord.y;\n  bool y1 \x3d p1.y \x3e vTexCoord.y;\n  bool y2 \x3d p2.y \x3e vTexCoord.y;\n\n  // could web be under the curve (after t1)?\n  if (y1 ? !y2 : y0) {\n    // add the coverage for t1\n    coverage.x +\x3d saturate(C1.x + 0.5);\n    // calculate the anti-aliasing for t1\n    weight.x \x3d min(weight.x, abs(C1.x));\n  }\n\n  // are we outside the curve (after t2)?\n  if (y1 ? !y0 : y2) {\n    // subtract the coverage for t2\n    coverage.x -\x3d saturate(C2.x + 0.5);\n    // calculate the anti-aliasing for t2\n    weight.x \x3d min(weight.x, abs(C2.x));\n  }\n}\n\n// this is essentially the same as coverageX, but with the axes swapped\nvoid coverageY(vec2 p0, vec2 p1, vec2 p2) {\n\n  vec2 C1, C2;\n  calulateCrossings(p0, p1, p2, C1, C2);\n\n  bool x0 \x3d p0.x \x3e vTexCoord.x;\n  bool x1 \x3d p1.x \x3e vTexCoord.x;\n  bool x2 \x3d p2.x \x3e vTexCoord.x;\n\n  if (x1 ? !x2 : x0) {\n    coverage.y -\x3d saturate(C1.y + 0.5);\n    weight.y \x3d min(weight.y, abs(C1.y));\n  }\n\n  if (x1 ? !x0 : x2) {\n    coverage.y +\x3d saturate(C2.y + 0.5);\n    weight.y \x3d min(weight.y, abs(C2.y));\n  }\n}\n\nvoid main() {\n\n  // calculate the pixel scale based on screen-coordinates\n  pixelScale \x3d hardness / fwidth(vTexCoord);\n\n  // which grid cell is this pixel in?\n  ivec2 gridCoord \x3d ifloor(vTexCoord * vec2(uGridSize));\n\n  // intersect curves in this row\n  {\n    // the index into the row info bitmap\n    int rowIndex \x3d gridCoord.y + uGridOffset.y;\n    // fetch the info texel\n    vec4 rowInfo \x3d getTexel(uSamplerRows, rowIndex, uGridImageSize);\n    // unpack the rowInfo\n    int rowStrokeIndex \x3d getInt16(rowInfo.xy);\n    int rowStrokeCount \x3d getInt16(rowInfo.zw);\n\n    for (int iRowStroke \x3d INT(0); iRowStroke \x3c N; iRowStroke++) {\n      if (iRowStroke \x3e\x3d rowStrokeCount)\n        break;\n\n      // each stroke is made up of 3 points: the start and control point\n      // and the start of the next curve.\n      // fetch the indices of this pair of strokes:\n      vec4 strokeIndices \x3d getTexel(uSamplerRowStrokes, rowStrokeIndex++, uCellsImageSize);\n\n      // unpack the stroke index\n      int strokePos \x3d getInt16(strokeIndices.xy);\n\n      // fetch the two strokes\n      vec4 stroke0 \x3d getTexel(uSamplerStrokes, strokePos + INT(0), uStrokeImageSize);\n      vec4 stroke1 \x3d getTexel(uSamplerStrokes, strokePos + INT(1), uStrokeImageSize);\n\n      // calculate the coverage\n      coverageX(stroke0.xy, stroke0.zw, stroke1.xy);\n    }\n  }\n\n  // intersect curves in this column\n  {\n    int colIndex \x3d gridCoord.x + uGridOffset.x;\n    vec4 colInfo \x3d getTexel(uSamplerCols, colIndex, uGridImageSize);\n    int colStrokeIndex \x3d getInt16(colInfo.xy);\n    int colStrokeCount \x3d getInt16(colInfo.zw);\n    \n    for (int iColStroke \x3d INT(0); iColStroke \x3c N; iColStroke++) {\n      if (iColStroke \x3e\x3d colStrokeCount)\n        break;\n\n      vec4 strokeIndices \x3d getTexel(uSamplerColStrokes, colStrokeIndex++, uCellsImageSize);\n\n      int strokePos \x3d getInt16(strokeIndices.xy);\n      vec4 stroke0 \x3d getTexel(uSamplerStrokes, strokePos + INT(0), uStrokeImageSize);\n      vec4 stroke1 \x3d getTexel(uSamplerStrokes, strokePos + INT(1), uStrokeImageSize);\n      coverageY(stroke0.xy, stroke0.zw, stroke1.xy);\n    }\n  }\n\n  weight \x3d saturate(1.0 - weight * 2.0);\n  float distance \x3d max(weight.x + weight.y, minDistance); // manhattan approx.\n  float antialias \x3d abs(dot(coverage, weight) / distance);\n  float cover \x3d min(abs(coverage.x), abs(coverage.y));\n  OUT_COLOR \x3d vec4(uMaterialColor.rgb, 1.) * uMaterialColor.a;\n  OUT_COLOR *\x3d saturate(max(antialias, cover));\n}\n",
